import React, { Component } from 'react'

export default class Slidebar extends Component {
    render() {
        return (
          <div>
              <div id="mySidenav" class="sidenav">
                <a href="#">About</a>
                <a href="#">Services</a>
                <a href="#">Clients</a>
                <a href="#">Contact</a>
              </div>
          </div>

        )
    }
}
